:"sidecar";}i:178;a:1:{s:8:"owner_id";i:51643386;}i:179;a:1:{s:14:"owner_username";s:0:"";}i:180;a:1:{s:14:"owner_fullname";s:0:"";}i:181;a:1:{s:9:"owner_pic";s:0:"";}i:182;a:1:{s:2:"id";s:19:"2390941720408117461";}i:183;a:1:{s:10:"short_code";s:11:"CEuVNOzllDV";}i:184;a:1:{s:12:"created_time";i:1599242485;}i:185;a:1:{s:7:"caption";s:1374:"White mountain direttissima: day 3.
19 miles. Peaks: Lincoln, Lafayette, Garfield, owls head.
I was in the clouds a lot today, so not many pics. Didn't really have much of a view going over Franconia ridge, which sucks because it's a beautiful section. Ate breakfast on Lafayette and talked to a couple AT thru hikers. The climb up Garfield was steep, but short and the view was pretty good. Headed down to 13 falls and entered the pemi wilderness. On the way down I got dumped on for about 5 minutes, but it had cleared up by the time I got to camp. I set up my tent, packed a couple snacks, then headed out to do the long out and back to owls head....let me just say, owls head is the worst...and most 4000ft hikers save it for last. The actual approach is a breeze, with a gradual climb and then a gradual descent for about 4 miles...then the trail breaks off and you head up the owls head slide, probably the steepest climb I've ever done. You gain 1400ft in just 0.6 milesüò≥üíÄ...and the real kicker; there is NO view at all at the summit. I tagged the summit and made my way back to camp, where my cold soaked rice dinner was waiting for me.....it's day 3 and I'm still gagging on m&ms.

